import React, { useState } from "react";

const Titleincrement = ()=>{
    const [count,setCount] =useState(0);
return(
    <>
        <button onClick={()=>{
              setCount(count+1)  
        }}>You Click me {count} </button>
    </>
)
}

export default Titleincrement;
